import React from 'react';
import {FlexWrapper} from "../../../components/FlexWrapper";
import {SectionTitle} from "../../../components/ScetionTitle";
import styled from "styled-components";
import photo_about_1 from '../../../assets/img/image_about_1.webp'

type StyledContainerPhotoPropsType = {
    width?: string
    height?: string
}


export const About = () => {
    return (
        <StyledAboutMe>
            <SectionTitle>ABOUT ME</SectionTitle>
            <FlexWrapper>
                <FlexWrapper direction='column'>
                    <StyledContainerPhoto width='330px' height='378px'>
                        <StyledImg1 src={photo_about_1}/>
                    </StyledContainerPhoto>
                    <StyledContainerPhoto width='307px' height='339px'>
                        <StyledImg2 src={photo_about_1}/>
                    </StyledContainerPhoto>
                </FlexWrapper>
                <StyledContainerPhoto width='496px' height='822px'>
                    <AboutText>Hello again everyone! So, you already know that my name is Gleb. A little about myself:
                        student, 18 y.o., athlete-football player, I love creativity since childhood, I live in Donetsk,
                        Ukraine. Why programming? Everything is elementary - I like it, the profession of the future,
                        thanks
                        to which I can provide myself and fulfill my dream - travel, at the moment I specialize in web
                        design, front-end and back-end development, turnkey websites. Why should you choose me? I
                        approach
                        each order with great responsibility and love, as I want to make a name for myself, exclude
                        plagiarism and negligence, fully study the project, the client and its target audience, work for
                        quality, trying to make an order as quickly and uniquely as possible, taking into account all
                        the
                        edits and wishes.
                        By trusting me, you will get the maximum return for your project, save your nerves and time.
                        If you are interested in me , you want to know something more or use my services, then I will
                        provide all my contacts below.</AboutText>
                </StyledContainerPhoto>
                <StyledContainerPhoto width='310px' height='485px'>
                    <StyledImg1 src={photo_about_1}/>
                </StyledContainerPhoto>
            </FlexWrapper>
        </StyledAboutMe>
    );
};

const StyledImg1 = styled.img`
  max-width: 272px;
  max-height: 320px;
`
const StyledImg2 = styled.img`
  max-width: 250px;
  max-height: 281px;
`

const StyledContainerPhoto = styled.div<StyledContainerPhotoPropsType>`
  width: ${props => props.width || '100px'};
  height: ${props => props.height || '100px'};
  background-color: gray;
  gap: 197px;

`

const AboutText = styled.p`
  display: inline-block;
  width: 370px;
  height: 796px;
`

const StyledAboutMe = styled.section``
